window.bookSummaryJSON = "<p>Caitlyn Aguirre should have been a magician. Her family certainly expected her to be a magician. But by the time she reached her 12th birthday, Caitlyn hadn't even managed to cast a single spell! In desperation, her parents send her - and her magical sisters - to Jude's Sorcerous Academy, her last best chance to discover her powers. </p> <p>But as she struggles to survive her classes without a single spell to her name, Caitlyn starts to uncover an ancient mystery that may prove the key to her true powers.... If she lives long enough to find it. </p>"; 
